import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { DeleteCommerceModalPageRoutingModule } from './delete-commerce-modal-routing.module';

import { DeleteCommerceModalPage } from './delete-commerce-modal.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    DeleteCommerceModalPageRoutingModule
  ],
  declarations: [DeleteCommerceModalPage]
})
export class DeleteCommerceModalPageModule {}
